    funded through the budget allocation process and reported through the FACTS database.
    Activities are self-reported by Forest Service Units. This layer represents select
    activities accomplished as a part of the timber harvest program of work. It is important
    to note that this layer does not contain all timber harvest activities because the
    spatial portion of the activity description is not required and is self-reported
    by Forest Service units. As spatial data is a new requirement for timber harvest
